  return (
    <>
    <div className="text">
    <h2>How It Works</h2>
    <p>Learn More about how our website works</p>
    </div>
    <div className="boxCont">
        <div className="box-2">
         {data.map((index,prop)=>{
          return(
          <div key="index">
          <img src={prop.img} alt="img"/>
          <h1>{prop.title}</h1>
          <p>{prop.desc}</p>
          </div>
          )
         })}
        </div>
    </div>
    </>

  )
}

